  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this study are to 1)
  Evaluate ecosystem-scale consequences of shrub land succession focusing on soil
  C fluxes (soil respiration) in a series of successional habitats including grassland/meadow,
  early successional shrub land, late successional shrub land, and early successional
  forest. 2) Examine vegetative characteristics associated with this successional
  sequence including herbaceous aboveground biomass, total belowground (root) biomass,
  and detrital production.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
